				private object FindFromObjectTree(string objectId)
				{
					{
						var item = ReferenceToInformation;
						if(item != null)
						{
							object result = item.FindObjectByID(objectId);
							if(result != null)
								return result;
						}
					}
					{
						var item = Address;
						if(item != null)
						{
							object result = item.FindObjectByID(objectId);
							if(result != null)
								return result;
						}
					}
					{
						var item = Location;
						if(item != null)
						{
							object result = item.FindObjectByID(objectId);
							if(result != null)
