				public void ParsePropertyValue(string propertyName, string value)
				{
					switch (propertyName)
					{
						case "HostName":
							HostName = value;
							break;
						case "ContentName":
							ContentName = value;
							break;
						case "Title":
							Title = value;
							break;
						case "Description":
							Description = value;
							break;
						case "ElementQuery":
							ElementQuery = value;
							break;
						case "Content":
							Content = value;
							break;
						case "RawContent":
							RawContent = value;
							break;
						case "IsEnabled":
							IsEnabled = bool.Parse(value);
							break;
						case "ApplyActively":
							ApplyActively = bool.Parse(value);
							break;
						case "EditType":
							EditType = value;
							break;
						case "PageLocation":
							PageLocation = value;
							break;
						default:
							throw new InvalidDataException("Primitive parseable data type property not found: " + propertyName);
					}
	        }
